textOriginal:
É esse o País que queremos? Um País que nos ultimos 4 anos só insitou a violência, o preconceito, a misoginia, o desrespeito ao STF, à democracia?... Esse é País que queremos pelos proximos 4 anos?... Como ainda pode existirem pessoas que votam nessas ideologias?... Não existe debate realmente político com Bolsonaro, não existe plano de governo, não existe planejamento de gestao administrativa gerencial na ideologia de governo desse cara. Por isso Lula desistiu de debater com ele, que sempre fugiu dos debates e agora quer dar uma de intelectual e gestor público... ou voces já esqueceram de sa primeira eleição, que ele fugiu de todos os debates, e só ofendia, cgritava, criticava...? Ele passou metade de seu governo fazendo ataques ao STF (esueceram do 7 de setembro?), ao povo brasileiro, incitação à violência, ao racismo, enfim. 
Acordem, ou será tarde demais...

